-1 | PERMANENT | I | TERMINATED | 1-1-2022 |\r\n      | DNI-2 | Name-2| Surname-2 | PERMANENT | I |TERMINATED |1-1-2022 |\r\n      | DNI-3 | Name-3| Surname-3 | PERMANENT | I |TERMINATED |1-1-2022 |\r\n    When I search mechanics in contract type PERMANENT\r\n    Then an empty list is returned\r\n    \r\n  Scenario: Find mechanics in an existent contract type \r\n     Given the following relation of mechanics with a contract in force\r\n      | dni  \t| name  | surname   | type | group | state | startDate |\r\n      | DNI-1 | Name-1| Surname-1 | PERMANENT | I | IN_FORCE |1-01-2022 |\r\n      | DNI-2 | Name-2| Surname-2 | PERMANENT | I |IN_FORCE |1-01-2022|\r\n      | DNI-4 | Name-4| Surname-4 | TEMPORARY | II |IN_FORCE |1-01-2022|\r\n    And the following relation of mechanics with a contract terminated  \r\n      | dni  \t| name  | surname   | type | group | state | startDate |\r\n      | DNI-3 | Name-3| Surname-3 | PERMANENT | I |TERMINATED |1-01-2022 |\r\n    When I search mechanics in contract type PERMANENT\r\n    Then we get the following list of mechanics \r\n      | mechanic\t\t\t\t\t\t\t\t |\r\n      | DNI-1,Name-1,Surname-1 |\r\n      | DNI-2,Name-2,Surname-2 |","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/omenp/Desktop/3rd%20grade/RI/Prácticas/P8%20JPA/ws8/acceptance_tests.cws_extension1/src/test/resources/uo/ri/cws/application/service/mechanic/FindWithContractType.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Find mechanics with contract in force in contract type","description":"","children":[{"scenario":{"location":{"line":7,"column":3},"tags":[{"location":{"line":4,"column":3},"name":"@FindMechanicsWithContractInFoceInContractType","id":"05da047f-a0c6-4a50-9cd5-ea932b25db4d"},{"location":{"line":6,"column":3},"name":"@IllegalArguments","id":"ad242861-7f22-4e87-89dc-050d8e727ed4"}],"keyword":"Scenario","name":"Try to find mechanics with null contrac s empty\r\n    \t\r\n\t\tScenario: Find an existent payroll \r\n     Given the following mechanic with a contract in force\r\n      | dni  \t| name  | surname   | type | group | state | startDate |\r\n      | DNI-1 | Name-1| Surname-1 | PERMANENT | I | IN_FORCE | 1-5-2022|\r\n  \tAnd One payroll for this contract this month \r\n   \tWhen I search a payroll by id\r\n   \tThen This payroll is returned\r\n    \t\r\n\t@getAllPayrollsForMechanic\r\n  \t@IllegalArgumentException\r\n\t  Scenario: Try to find a payroll with null mechanic id\r\n\t  \tWhen I try to find payrolls with null mechanic id\r\n  \t  Then argument is rejected with an explaining message\r\n\r\n\t  Scenario Outline: Try to find a payroll with invalid mechanic id\r\n  \t  When I try to find payrolls with mechanic <id> argument\r\n    \tThen argument is rejected with an explaining message\r\n \t\tExamples:\r\n \t\t|  id  |\r\n \t\t| \"\"   |\r\n \t\t| \"   \"|\r\n \t\t\t\r\n  \t@BusinessException\r\n\t\tScenario: Find payrolls for a non existent mechanic \r\n    \tWhen I try to find payrolls with a non existent id\r\n\t    Then an error happens with an explaining message\r\n \t\t\t\r\n\t\t@PositiveCases\r\n\t\r\n\t  Scenario: Find payrolls for a mechanid with no payroll \r\n     Given the following mechanic with a contract in force\r\n      | dni  \t| name  | surname   | type | group | state |\r\n      | DNI-1 | Name-1| Surname-1 | PERMANENT | I | IN_FORCE |\r\n\t    When I search payrolls for the mechanic\r\n    \tThen Result is empty\r\n\t    \r\n\t  Scenario: Find payrolls for a mechanid with one payroll \r\n     Given the following mechanic with a contract in force\r\n      | dni  \t| name  | surname   | type | group | state |\r\n      | DNI-1 | Name-1| Surname-1 | PERMANENT | I | IN_FORCE |\r\n\t    And One payroll for this contract this month\r\n\t    When I search payrolls for the mechanic\r\n\t    Then The payroll summary for this mechanic is found\r\n\t    \r\n\t  Scenario: Find payrolls for a m
